import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Toggle from './Toggle';
import Volume from './Volume';
import Heater_1 from './Assets/Heater-1.mp3'
import Heater_2 from './Assets/Heater-2.mp3'
import Heater_3 from './Assets/Heater-3.mp3'
import Heater_4 from './Assets/Heater-4_1.mp3'
import clap from './Assets/Heater-6.mp3'
import open_hh from './Assets/Dsc_Oh.mp3'
import Kick_n_Hat from './Assets/Kick_n_Hat.mp3'
import kick from './Assets/RP4_KICK_1.mp3'
import closed_hh from './Assets/Cev_H2.mp3'

// import { useState, useEffect } from 'react'
const test = () =>{
  console.log("It is working");
}

const Body = () =>{
  return(
    <div className='container'>
      <div id='drum-machine'>
          {/* Creating the drum kit */}
          <div className='drum-kit'>
            <button className='drum-pad btn' id='heater-1' onClick={() =>{
              new Audio(Heater_1).play();
            }}><p>Q</p>
              <audio src={Heater_1} id='Q' className='clip'></audio>
            </button>


            <button className='drum-pad btn' id='heater-2' onClick={() =>{
              new Audio(Heater_2).play();
            }}>
              <p>W</p>
              <audio src={Heater_2} id='W' className='clip'></audio>
            </button>

            <button className='drum-pad btn' id='heater-3' onClick={() =>{
              new Audio(Heater_3).play()
            }}>
              <p>E</p>
              <audio src={Heater_3} id='E' className='clip'></audio>
            </button>


            <button className='drum-pad btn' id='heater-4' onClick={() =>{
              new Audio(Heater_4).play();
            }}> 
              <p>A</p>
              <audio src={Heater_4} id='A' className='clip'></audio>
            </button>


            <button className='drum-pad btn' id='clap' onClick={() =>{
              new Audio(clap).play();
            }}>
              <p>S</p>
              <audio src={clap} id='S' className='clip'></audio>
            </button>


            <button className='drum-pad btn' id='open-hh' onClick={() =>{
              new Audio(Heater_4).play();
            }}>
              <p>D</p>
              <audio src={open_hh} id='D' className='clip'></audio>
            </button>


            <button className='drum-pad btn' id='kick-n-hat'>
              <p>Z</p>
              <audio src={Kick_n_Hat} id='Z' className='clip'></audio>
            </button>
            <button className='drum-pad btn' id='kick'>
              <p>X</p>
              <audio src={kick} id='X' className='clip'></audio>
            </button>
            <button className='drum-pad btn' id='closed-hh'>
              <p>C</p>
              <audio src={closed_hh} id='C' className='clip'></audio>
            </button>
          </div>

          {/* Creating the two toggle buttons, the screen and, the volume button*/}

          {/* power button */}
          <div className='toggle1'>
            <Toggle label="Power" toggled={true} onClick={test} />
          </div>

          {/* screen display */}
          <div id='display'>
            <p>volume: 55</p>
          </div>

          {/* volume slider */}
          <div className='volume-btn'>
            <Volume/>
          </div>


          {/* Bank button */}
          <div className='toggle2'>
            <Toggle label="Bank" toggled={false} onClick={test} />
          </div>


        </div>
      </div>
  )
}

const App = () => {
  return (
    <div>
      <Body />
    </div>
  )
}

export default App
